import {makeStyles} from '@material-ui/core/styles'
const useStyles = makeStyles((theme)=>({
   box:{
      position:'relative',
      display:'flex',
      alignItems:'center',
      justifyContent:'center',
      textAlign:'center',
      height:'120vh',
      overflow:'hidden'
   },
   banner:{
      display:'block',
      height:'auto',
      width:'100%'
   }
}))


export default useStyles
